    "",ntt"description": "A map service on the www depicting geopolitical data
    for the entire area of the United States and territories. This includes States,
    Counties or Boroughs, Congressional Districts, Alaska Recording Districts, County
    Subdivisions, and Places boundaries that are derived from the latest official Census
    Bureau and Alaska Department of Natural Resources datasets. This offers the combination
    of the most recent Census Bureau and Alaska DNR geopolitical data with geopolitical
    boundaries within Forest Service lands that have been adjusted for better accuracy
    and for vertical integration with Forest Service data. Since it is vertically integrated
    when coincident with Forest Service lands, this dataset allows for better multi-layer
    analysis with other Forest Service lands data, and improved cartographic applications
    where Census data and Forest Service data need to be depicted in the same map. Features
    within Forest Service Administrative Forest boundaries may have been modified by
    the Forest Service for improved accuracy and spatial coincidence (vertical integration).",ntt"format":
